import React from 'react';
import styled from 'styled-components';
import DateDay from './DateDay';
import DateMonth from './DateMonth';

const FlexContainer = styled.div`
    display: flex;
    justify-content: center;
`;

const Calendar = () => {
  return (
    <FlexContainer>
      <DateDay></DateDay>
      <DateMonth></DateMonth>
    </FlexContainer>
  )
}

export default Calendar;
